function UnresolvedExitComponent(backendId) {
  this.backendId = backendId;
}

UnresolvedExitComponent.prototype.getBackendId = function () {
  return this.backendId;
}

UnresolvedExitComponent.prototype.getExitComponentAsStr = function () {
  return '{[UNRESOLVED][' + this.backendId + ']}';
}

module.exports.UnresolvedExitComponent = UnresolvedExitComponent;